import Header from  './Header'
import Menu from  './Menu'
import Body from  './Body'
import Footer from  './Footer'

function App() {
  return (
    <div className="wrapper">
      <Header/>
      <Menu/>
      <Body/>
      <Footer/>
    </div>
  );
}

export default App;
